import React from 'react'
import { AuthConsumer } from '../helper/AuthContext'

function Home() {
    return (
        <section id="home">
            <AuthConsumer>
                {({ user, logout }) => (
                    <button className="btn logout-btn" onClick={logout}>
                        Logout
                    </button>
                )}
            </AuthConsumer>
        </section>
    )
}

export default Home
